import React from "react";
import {
  Link,
  withRouter
} from "react-router-dom";
import ReactTooltip from 'react-tooltip'

function Header(props) {
  function handleLogout(){
    localStorage.clear()
    props.history.push('/')
  }

  return (
    <div className="topo">
      <p>Seja bem-vindo: {this.props.nome}</p>
    </div>
  );
}

export default withRouter(Header);
